			shellScript = "# Merge Script\n\n# 1\n# Set bash script to exit immediately if any commands fail.\nset -e\n\n# 2\n# Setup some constants for use later on.\nFRAMEWORK_NAME=\"ASDKUI\"\nSAMPLEAPP_NAME=\"ASDKSampleApp\"\n\nUNIVERSAL_OUTPUTFOLDER=${SRCROOT}/Builds/UI-${CONFIGURATION}-universal\nIPHONE_DEVICE_BUILD_DIR=${SRCROOT}/Builds/UI-${CONFIGURATION}-iphoneos\nIPHONE_SIMULATOR_BUILD_DIR=${SRCROOT}/Builds/UI-${CONFIGURATION}-iphonesimulator\n\nSAMPLEAPP_FRAMEWORKFOLDER=${SRCROOT}/\"SampleProject\"/${SAMPLEAPP_NAME}/\"ASDK\"\n\n# 3\n# If remnants from a previous build exist, delete them.\n\nif [ -d \"${UNIVERSAL_OUTPUTFOLDER}\" ]; then\nrm -rf \"${UNIVERSAL_OUTPUTFOLDER}\"\nfi\nmkdir -p \"${UNIVERSAL_OUTPUTFOLDER}\"\n\nif [ -d \"${IPHONE_DEVICE_BUILD_DIR}\" ]; then\nrm -rf \"${IPHONE_DEVICE_BUILD_DIR}\"\nfi\nmkdir -p \"${IPHONE_DEVICE_BUILD_DIR}\"\n\nif [ -d \"${IPHONE_SIMULATOR_BUILD_DIR}\" ]; then\nrm -rf \"${IPHONE_SIMULATOR_BUILD_DIR}\"\nfi\nmkdir -p \"${IPHONE_SIMULATOR_BUILD_DIR}\"\n\n# 4\n# Build the framework for device and for simulator (using\n# all needed architectures).\n\nxcodebuild -project \"ASDKUI.xcodeproj\" -target \"ASDKUI\" -configuration \"${CONFIGURATION}\" clean build -arch arm64 -arch armv7 -arch armv7s only_active_arch=no defines_module=yes -sdk iphoneos CONFIGURATION_BUILD_DIR=\"${IPHONE_DEVICE_BUILD_DIR}\" OTHER_CFLAGS=\"-fembed-bitcode\"\n\nxcodebuild -project \"ASDKUI.xcodeproj\" -target \"ASDKUI\" -configuration \"${CONFIGURATION}\" clean build -arch x86_64 -arch i386 only_active_arch=no defines_module=yes -sdk iphonesimulator CONFIGURATION_BUILD_DIR=\"${IPHONE_SIMULATOR_BUILD_DIR}\" OTHER_CFLAGS=\"-fembed-bitcode\"\n\n\n\n# 5\n# Remove .framework file if exists on Desktop from previous run.\nif [ -d \"${UNIVERSAL_OUTPUTFOLDER}/${FRAMEWORK_NAME}.framework\" ]; then\nrm -rf \"${UNIVERSAL_OUTPUTFOLDER}/${FRAMEWORK_NAME}.framework\"\nfi\n\n# 6\n# Copy the device version of framework to Desktop.\ncp -r \"${IPHONE_DEVICE_BUILD_DIR}/${FRAMEWORK_NAME}.framework\" \"${UNIVERSAL_OUTPUTFOLDER}/${FRAMEWORK_NAME}.framework\"\n\n# 7\n# Replace the framework executable within the framework with\n# a new version created by merging the device and simulator\n# frameworks' executables with lipo.\nlipo -create -output \"${UNIVERSAL_OUTPUTFOLDER}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${IPHONE_DEVICE_BUILD_DIR}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${IPHONE_SIMULATOR_BUILD_DIR}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n\n# 8\n# Copy the Swift module mappings for the simulator into the\n# framework.  The device mappings already exist from step 6.\nif [ -d \"${IPHONE_SIMULATOR_BUILD_DIR}/${FRAMEWORK_NAME}.framework/Modules/{FRAMEWORK_NAME}.swiftmodule/\" ]; then\ncp -r \"${IPHONE_SIMULATOR_BUILD_DIR}/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule/\" \"${UNIVERSAL_OUTPUTFOLDER}/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule\"\nfi\n\n# 9\n# Delete the most recent build.\nif [ -d \"${IPHONE_DEVICE_BUILD_DIR}\" ]; then\nrm -rf \"${IPHONE_DEVICE_BUILD_DIR}\"\nfi\n\nif [ -d \"${IPHONE_SIMULATOR_BUILD_DIR}\" ]; then\nrm -rf \"${IPHONE_SIMULATOR_BUILD_DIR}\"\nfi\n\n\nif [ -d \"${SAMPLEAPP_FRAMEWORKFOLDER}/${FRAMEWORK_NAME}.framework\" ]; then\nrm -rf \"${SAMPLEAPP_FRAMEWORKFOLDER}/${FRAMEWORK_NAME}.framework\"\n\ncp -r \"${UNIVERSAL_OUTPUTFOLDER}/${FRAMEWORK_NAME}.framework\" \"${SAMPLEAPP_FRAMEWORKFOLDER}\"\nfi";
